    if ( _ISA($fh, 'IO::String') ) {
        return 1;
    }
    if ( _ISA($fh, 'IO::Seekable') ) {
        # Unfortunately, some things like FileHandle objects
        # return true for Seekable, but AREN'T!!!!!
        if ( _ISA($fh, 'FileHandle') ) {
            return 0;
        } else {
            return 1;
        }
